import { backendAPI } from '../../api';
import { stringify } from 'querystring';

class RoomServiceImplementation {
  async getAll(filter) {
    const rooms = await backendAPI.get(`rooms?${stringify(filter !== null && filter !== void 0 ? filter : {})}`);
    return rooms.data;
  }

  async getMostPopular() {
    const mostPopularRooms = await backendAPI.get('rooms/most_popular');
    return mostPopularRooms.data;
  }

  async getByID(roomID) {
    const room = await backendAPI.get(`rooms/${roomID}`);
    return room.data;
  }

}

